import classes from './MealItem.module.css'
import React from 'react'

export default function MealItem(props)
{
  const price = `$  {props.price.toFixed(2)}`
  return (
    <>
    
      <li>
        <div><h3>{props.name}</h3></div>
        <div> {props.discription}</div>
        <div>{ price}</div>

    </li>
    
    </>
  )
}
